import React from 'react';
import classes from './RoomsList.module.css';

const RoomsList = props => {
  return (
    <ul className={classes['rooms-list']}>
      {props.rooms.map((room) => (
        <li>{room.title}</li>
      ))}
    </ul>
  );
};

export default RoomsList;
